import React, { useState } from 'react';
import './css/fonts.css';
import './css/index.css';

function Button(props) {
  const [isPressed, setIsPressed] = useState(false);

  const handleClick = () => {
    setIsPressed(true);
    props.action();
  };

  return (
    <button
      onClick={handleClick}
      className="button-56"
    >
      {props.text}
    </button>
  );
}

export default Button;
